import React from 'react';
import { connect } from 'redux-bundler-react';
import {
  Map,
  addData,
  basemapSwitcher,
  bookmarks,
  coordDisplay,
  draw,
  geocoder,
  identify,
  measureTools,
  rotateNorth,
  zoomInOut,
  zoomHome,
  zoomToBox
} from "@corpsmap/corpsmap";
import "@corpsmap/corpsmap/css/corpsmap.css";

class MapPage extends React.Component {
  componentDidMount(){
    const { doMapInitialize } = this.props;
    doMapInitialize(this.el)
  }
  render(){
    return (
      <div style={{ padding: 0 }}>
        <div className="container-fluid" style={{ padding: 0 }}>
            <Map
              theme="grey-cararra"
              plugins={[
                addData,
                basemapSwitcher,
                bookmarks,
                coordDisplay,
                draw,
                geocoder,
                identify,
                measureTools,
                rotateNorth,
                zoomInOut,
                zoomHome,
                zoomToBox,
                cm2Plugin
              ]}
            />        
        </div>


          </div>
    )
  }
}
export default connect(
  'doMapInitialize',
  MapPage
  );
